import React, { FC } from "react";
import { Flex } from "@orderly.network/ui";

/**
 * NetworkDiagram component - displays a static network diagram as a background image
 * This is a pure UI component with no interactive functionality
 * The diagram is rendered using a base64 encoded PNG as background image
 */

// Base64 encoded network diagram image
const NETWORK_DIAGRAM_IMAGE = `
data:image/png;base64,
`;

export type NetworkDiagramProps = {
  className?: string;
  style?: React.CSSProperties;
};

export const NetworkDiagram: FC<NetworkDiagramProps> = (props) => {
  const { style } = props;

  return (
    <Flex
      justify="center"
      itemAlign="center"
      className="oui-w-full oui-h-full"
      style={{
        backgroundImage: `url(${NETWORK_DIAGRAM_IMAGE})`,
        backgroundSize: "cover",
        backgroundRepeat: "no-repeat",
        backgroundPosition: "center",
        ...style,
      }}
      id="oui-affiliate-landing-network-diagram"
    />
  );
};
